Sand De Lee- crazy weather. I got lucky getting into the moto’s. Was able to go 34-35 on the day. Not my best work. I really need to quit being so nice when I get lapped. I instantly go backwards and just move out of the way for anyone coming. I need to remember im racing too. Haven’t been really happy the last two weeks with my riding and know I should be way farther up the grid if I ride like I can. 

I’ll miss Riverglade, I couldn’t get a flight booked in time but you will see me next weekend at Deschambault!

Thanks to my team and supporters. 

